import { Link } from 'react-router-dom';
import Logo from '../../Icons/Logo/Logo';

const Header = () => {
  return (
    <header className="body-font">
      <div className="container mx-auto flex flex-row flex-wrap items-center px-5 py-3 md:flex-row md:p-5">
        <Link className="title-font flex h-10 items-center font-medium" to="/">
          <Logo className="h-10 w-10" />

          <span className="ml-3 hidden text-xl font-normal sm:block">Provision your identity</span>
        </Link>
        <nav className="ml-auto flex flex-wrap items-center justify-center text-base"></nav>
      </div>
    </header>
  );
};

export default Header;
